import classes from './NewMeetupsForm';
import Card from '../UI/Card';

const NewMeetupsForm = () => {
    return (
        <Card>
            <form className={classes.form}>
                <div className={classes.control}></div>
                <label></label>
        </form>
</Card>
    )
}

export default NewMeetupsForm;
